import base64
import cv2
import numpy as np

# Supongamos que recibiste el JSON de la API
respuesta = {
  "mensaje": "Grad-CAM generado",
  "prediccion": 0.9963584542274475,
  "imagen_gradcam": ""
}

# Decodificar base64 a bytes
img_bytes = base64.b64decode(respuesta["imagen_gradcam"])

# Convertir a array de NumPy
nparr = np.frombuffer(img_bytes, np.uint8)
img = cv2.imdecode(nparr, cv2.IMREAD_COLOR)

# Mostrar la imagen
cv2.imshow("Grad-CAM", img)
cv2.waitKey(0)
cv2.destroyAllWindows()

# O guardar en archivo
cv2.imwrite("gradcam.png", img)